import React from 'react'
import ReactDOM from 'react-dom'

const Hello = () => {
    return (
        <div>
            <p>Hello world</p>
        </div>
    )
}

const App = () => (
    <div>
        <h1>Greetings</h1>
        <Hello />
    </div>
)

ReactDOM.render(<App />, document.getElementById('root'))



